import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import API from "../api";

export default function Dashboard() {
  const [available, setAvailable] = useState([]);
  const [upcoming, setUpcoming] = useState([]);
  const [enrolled, setEnrolled] = useState([]);
  const nav = useNavigate();
  const token = localStorage.getItem("token");

  useEffect(() => {
    if (token) {
      fetchEnrolled().then(() => {
        fetchCourses();
      });
    } else {
      fetchCourses();
    }
  }, [token]);

  async function fetchCourses() {
    try {
      const res = await API.get("/courses");
      const today = new Date();
      const started = res.data.filter((c) => new Date(c.start_date) <= today);
      const upcomingCourses = res.data.filter(
        (c) => new Date(c.start_date) > today
      );
      const filteredStarted = started.filter(
        (course) => !enrolled.some((e) => e.id === course.id)
      );
      setAvailable(filteredStarted);
      setUpcoming(upcomingCourses);
    } catch (e) {
      console.error(e);
    }
  }

  async function fetchEnrolled() {
    try {
      const res = await API.get("/enrollments");
      setEnrolled(res.data);
      return res.data;
    } catch (e) {
      console.error(e);
    }
  }

  async function enroll(courseId) {
    if (!token) {
      alert("Please login to enroll in a course.");
      nav("/login");
      return;
    }
    try {
      await API.post("/enrollments", { course_id: courseId });
      alert("‚úÖ Enrolled successfully!");
      await fetchEnrolled();
      fetchCourses();
    } catch (e) {
      console.error(e);
      alert(e?.response?.data?.message || "Error");
    }
  }

  async function handleUnenroll(courseId) {
    if (!window.confirm("Are you sure you want to unenroll from this course?")) return;
    try {
      await API.delete(`/enrollments/${courseId}`);
      alert("‚ùå Unenrolled successfully!");
      await fetchEnrolled();
      fetchCourses();
    } catch (e) {
      console.error(e);
      alert("Error while unenrolling");
    }
  }

  return (
    <div
      style={{
        padding: 20,
        fontFamily: "Inter, system-ui, -apple-system, sans-serif",
        background: "linear-gradient(135deg, #fff7ed 0%, #fde68a 50%, #fef3c7 100%)",
        minHeight: "100vh",
      }}
    >
      <h1
        style={{
          background: "linear-gradient(90deg, #f97316, #b45309)",
          WebkitBackgroundClip: "text",
          WebkitTextFillColor: "transparent",
          fontSize: "3rem",
          fontWeight: "800",
          marginBottom: 40,
          textAlign: "center",
          letterSpacing: "1px",
          textShadow: "2px 2px 8px rgba(0,0,0,0.1)"
        }}
      >
        EduTrack üìö
      </h1>

      {token && (
        <Section title="Your Enrolled Courses">
          {enrolled.length === 0 ? (
            <EmptyState text="You haven't enrolled in any course yet." />
          ) : (
            <CourseGrid>
              {enrolled.map((c) => (
                <CourseCard
                  key={c.id}
                  title={c.title}
                  instructor={c.instructor}
                  description={c.description}
                  primaryAction={
                    <Link to={`/course/${c.id}`} style={styles.greenButton}>
                      Go to Course
                    </Link>
                  }
                  secondaryAction={
                    <button
                      onClick={() => handleUnenroll(c.id)}
                      style={styles.redButton}
                    >
                      Unenroll
                    </button>
                  }
                />
              ))}
            </CourseGrid>
          )}
        </Section>
      )}

      <Section title="Available Courses">
        {available.length === 0 ? (
          <EmptyState text="No courses have started yet." />
        ) : (
          <CourseGrid>
            {available.map((c) => (
              <CourseCard
                key={c.id}
                title={c.title}
                instructor={c.instructor}
                description={c.description}
                primaryAction={
                  <button
                    onClick={() => enroll(c.id)}
                    style={styles.orangeButton}
                  >
                    Enroll
                  </button>
                }
              />
            ))}
          </CourseGrid>
        )}
      </Section>

      <Section title="Upcoming Courses">
        {upcoming.length === 0 ? (
          <EmptyState text="No upcoming courses." />
        ) : (
          <ul
            style={{
              listStyle: "none",
              padding: 0,
              display: "grid",
              gap: 12,
            }}
          >
            {upcoming.map((u) => (
              <li
                key={u.id}
                style={{
                  padding: 16,
                  borderRadius: 16,
                  background: "rgba(255, 255, 255, 0.85)",
                  backdropFilter: "blur(10px)",
                  WebkitBackdropFilter: "blur(10px)",
                  boxShadow: "0 4px 15px rgba(0,0,0,0.08)",
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  border: "1px solid rgba(255,255,255,0.4)",
                }}
              >
                <span style={{ fontSize: 16, color: "#1e293b", fontWeight: 600 }}>
                  <strong>{u.title}</strong> (starts{" "}
                  {new Date(u.start_date).toLocaleDateString()})
                </span>
                <button
                  disabled
                  style={{
                    backgroundColor: "#9ca3af",
                    color: "#fff",
                    padding: "8px 14px",
                    borderRadius: 8,
                    border: "none",
                    opacity: 0.6,
                    cursor: "not-allowed",
                  }}
                >
                  Locked
                </button>
              </li>
            ))}
          </ul>
        )}
      </Section>
    </div>
  );
}

function Section({ title, children }) {
  return (
    <section style={{ marginBottom: 50 }}>
      <h2
        style={{
          fontSize: "2rem",
          marginBottom: 25,
          fontWeight: "700",
          background: "linear-gradient(90deg, #f97316, #ea580c)",
          WebkitBackgroundClip: "text",
          WebkitTextFillColor: "transparent",
          textShadow: "1px 1px 4px rgba(0,0,0,0.05)",
        }}
      >
        {title}
      </h2>
      {children}
    </section>
  );
}

function CourseGrid({ children }) {
  return (
    <div
      style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fill,minmax(320px,1fr))",
        gap: 25,
      }}
    >
      {children}
    </div>
  );
}

function CourseCard({ title, instructor, description, primaryAction, secondaryAction }) {
  return (
    <div
      style={{
        padding: 24,
        borderRadius: 20,
        backgroundColor: "rgba(255, 255, 255, 0.85)",
        backdropFilter: "blur(12px)",
        WebkitBackdropFilter: "blur(12px)",
        boxShadow: "0 6px 20px rgba(0,0,0,0.12)",
        border: "1px solid rgba(255, 255, 255, 0.4)",
        transition: "transform 0.25s ease, box-shadow 0.25s ease",
      }}
      onMouseEnter={(e) => (e.currentTarget.style.transform = "translateY(-6px) scale(1.03)")}
      onMouseLeave={(e) => (e.currentTarget.style.transform = "translateY(0) scale(1)")}
    >
      <h3
        style={{
          fontSize: "1.4rem",
          fontWeight: "700",
          color: "#1e293b",
          marginBottom: 8,
        }}
      >
        {title}
      </h3>
      <p style={{ fontSize: 14, fontWeight: 500, color: "#475569", marginBottom: 6 }}>
        {instructor}
      </p>
      <p
        style={{
          marginTop: 8,
          fontSize: 15,
          color: "#4b5563",
          lineHeight: 1.6,
          minHeight: "50px",
        }}
      >
        {description?.slice(0, 120)}...
      </p>
      <div
        style={{
          marginTop: 18,
          display: "flex",
          gap: 10,
          justifyContent: secondaryAction ? "space-between" : "flex-start",
        }}
      >
        {primaryAction}
        {secondaryAction}
      </div>
    </div>
  );
}

function EmptyState({ text }) {
  return (
    <p style={{ color: "#6b7280", fontStyle: "italic", fontSize: 16 }}>
      {text}
    </p>
  );
}

const styles = {
  orangeButton: {
    background: "linear-gradient(90deg, #f97316, #ea580c)",
    color: "#fff",
    padding: "10px 16px",
    borderRadius: 10,
    border: "none",
    fontWeight: "600",
    cursor: "pointer",
    boxShadow: "0 3px 8px rgba(234, 88, 12, 0.4)",
    transition: "transform 0.2s, box-shadow 0.2s",
  },
  greenButton: {
    background: "linear-gradient(90deg, #10b981, #059669)",
    color: "#fff",
    padding: "10px 16px",
    borderRadius: 10,
    border: "none",
    fontWeight: "600",
    textDecoration: "none",
    textAlign: "center",
    display: "inline-block",
    boxShadow: "0 3px 8px rgba(5, 150, 105, 0.4)",
    transition: "transform 0.2s, box-shadow 0.2s",
  },
  redButton: {
    background: "linear-gradient(90deg, #dc2626, #991b1b)",
    color: "#fff",
    padding: "10px 16px",
    borderRadius: 10,
    border: "none",
    fontWeight: "600",
    cursor: "pointer",
    boxShadow: "0 3px 8px rgba(185, 28, 28, 0.4)",
    transition: "transform 0.2s, box-shadow 0.2s",
  },
};
